import React from 'react'
import Slider from "react-slick";


const Carrousel = () => {

      return (
        <Slider>
            <img src={imageUrl1} width="100%" />
            <img src={imageUrl2} width="100%" />
            <img src={imageUrl3} width="100%" />
        </Slider>
      );
}
 
export default Carrousel;
